import React, { useState } from 'react';
import './adminaccess.css';

const AdminLogin = ({ closeModal }) => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you can add logic to verify the admin credentials
    console.log('Admin Username:', username);
    console.log('Admin Password:', password);
    
    // Close modal after successful submission (this can be conditional if credentials are correct)
    closeModal();
  };

  return (
    <div className="admin-modal">
      <div className="admin-modal-content">
        <span className="admin-close" onClick={closeModal}>&times;</span>
        <h2>Admin Login</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Username:
            <input 
              type="text" placeholder="user"
              value={username} 
              onChange={(e) => setUsername(e.target.value)} 
              required 
            />
          </label>
          <label>
            Password:
            <input 
              type="password" 
              value={password} 
              onChange={(e) => setPassword(e.target.value)} 
              required 
            />
          </label>
          <button type="submit">Login</button>
        </form>
      </div>
    </div>
  );
};

export default AdminLogin;
